import {
  InformeMensualSupervision,
  Resultado,
} from '../models/informe-mensual-supervision';
import { Margins } from 'pdfmake/interfaces';

export class ReporteMensualSupervisionDefinition {
  getDocumentDefinition(datosReporte: InformeMensualSupervision) {
    let content: any = [];

    content.push({ text: datosReporte.direccionTecnica, bold: true });
    content.push({
      text: 'Dirección Técnica',
      bold: true,
      margin: [0, 0, 0, 10],
    });
    content.push({
      text:
        'Asunto: Informe Mensual de Supervisión correspondiente al mes de ' +
        datosReporte.mesReporte +
        '.',
      fontSize: 8,
      margin: [0, 0, 0, 10],
    });
    content.push([
      {
        stack: [
          'Q. María Margarita Dafne Lobato Calleros',
          'Gerente de Calidad del Agua',
          'Presente',
        ],
        bold: true,
      },
    ]);

    content.push([
      { text: 'Atención a:', bold: true, alignment: 'right' },
      datosReporte.atencion.map((f) => {
        return { text: f, bold: true, alignment: 'right' };
      }),
    ]);

    content.push({
      text:
        'En referencia al contrato ' +
        datosReporte.contrato +
        ', con el cual la Comisión Nacional del Agua encomendó a “EL PROVEEDOR” y éste se obliga a realizar hasta su total terminación el "' +
        datosReporte.denominacionContrato +
        '" consistente en los servicios profesionales de una empresa competente y calificada que apoye en las actividades de la Subdirección General Técnica (SGT) a través de la recolecta, preservación y transporte de muestras de agua a los laboratorios, realización de análisis, generación y entrega de resultados de calidad del agua de 2300 a 5000 sitios ubicados en lugares estratégicos con objeto de obtener resultados representativos y confiables.',
      margin: [0, 15, 0, 10],
      alignment: 'justify',
    });

    content.push({
      text: 'En particular, sobre el Numeral 14. SUPERVISIÓN DEL SERVICIO de los Términos de Referencia que a la letra dice:',
      alignment: 'justify',
    });

    content.push({
      text: datosReporte.indicaciones,
      italics: true,
      alignment: 'justify',
      margin: [15, 10, 15, 10],
    });

    content.push({
      text: 'Al respecto, se informan los sitios de muestreo supervisados por este Organismo de Cuenca con sus respectivas calificaciones anexando los formatos de supervisión para su referencia y observación.',
      alignment: 'justify',
      margin: [0, 15],
    });

    datosReporte.resultados.forEach((res) => {
      content.push(
        {
          stack: [
            res.ocdl,
            'Número de sitios supervisados: ' + res.totalSitios,
          ],
          fontSize: 8,
          bold: true,
        },
        // { text: res.ocdl },
        // { text: 'Número de sitios supervisados: ' + res.totalSitios },
        {
          margin: [0, 10, 0, 15],
          fontSize: 8,
          table: {
            widths: [90, 50, 50, 50, 50, 50, 50, 50, 50],
            body: this.getBody(res),
          },
        }
      );
    });

    content.push([
      {
        text: 'Sin otro particular, le envío un cordial saludo.',
        margin: [0, 30, 0, 50],
      },
      {
        text: 'Atentamente',
        fontSize: 10,
        margin: [0, 0, 0, 50],
      },
      {
        text: datosReporte.nombreFirma,
        fontSize: 11,
        bold: true,
      },
      {
        text: datosReporte.puestoFirma,
        margin: [0, 0, 0, 50],
      },
      {
        columns: [
          {
            text: 'c.c.e.p.-',
            width: 40,
          },
          [
            datosReporte.copias.map((f) => {
              return { text: f.nombre + '. - ' + f.puesto };
            }),
            { text: datosReporte.personasInvolucradas },
          ],
        ],
      },
    ]);

    var dd = {
      pageMargins: [50, 100, 50, 80] as Margins,
      header: this.getHeader(
        datosReporte.oficio,
        datosReporte.lugar,
        datosReporte.fecha
      ),
      footer: this.getFooter(),
      content: content,
      styles: {
        header: {
          bold: true,
        },
      },
      defaultStyle: {
        fontSize: 9,
      },
    };

    return dd;
  }

  getHeader(oficio: any, lugar: any, fecha: any) {
    let header: any = {};

    header = {
      fontSize: 8,
      margin: [50, 30, 30, 10],
      columns: [
        {
          image: this.getHeaderImage(),
          width: 350,
        },
        [
          { text: 'Oficio', bold: true, margin: [10, 0, 0, 0] },
          { text: oficio, margin: [10, 0, 0, 0] },
          { text: 'Lugar', bold: true, margin: [10, 5, 0, 0] },
          { text: lugar, margin: [10, 0, 0, 0] },
          { text: 'Fecha', bold: true, margin: [10, 5, 0, 0] },
          { text: fecha, margin: [10, 0, 0, 0] },
        ],
      ],
    };

    return header;
  }

  getFooter() {
    let footer: any = {};

    footer = [
      {
        text: 'Avenida José Loreto Fabela núhumero 850, Colonia San Juan de Aragón, Alcaldía Gustavo A. Madero, Código Postal 07950, Ciudad de México. Teléfono: 55 2158 1000   www.gob.mx/conagua',
        fontSize: 7,
        margin: [50, 10, 0, 0],
      },
      {
        image: this.getFooterImage(),
        width: 540,
        height: 50,
        margin: [50, 0, 0, 0],
        // margin: [40, 20, 40, 10],
      },
    ];

    return footer;
  }

  getBody(resultado: Resultado) {
    let body: any = [];
    let firstRow: any = [];
    let secondRow: any = [];
    let thirdRow: any = [];

    firstRow.push({
      text: 'INTERVALO DE CALIFICACIÓN',
      alignment: 'center',
      margin: [10, 0, 10, 0],
    });
    secondRow.push({
      text: 'TOTAL DE SITIOS POR INTERVALO',
      alignment: 'center',
      margin: [10, 0, 10, 0],
    });
    thirdRow.push({
      text: 'PORCENTAJE (%)',
      alignment: 'center',
      margin: [10, 5, 10, 0],
    });

    resultado.intervalos.forEach((f) => {
      firstRow.push({
        text: f.calificacion,
        alignment: 'center',
        margin: [10, 5, 10, 5],
      });
      secondRow.push({
        text: f.numeroSitios,
        alignment: 'center',
        margin: [10, 5, 10, 5],
      });
      thirdRow.push({
        text: f.porcentaje,
        alignment: 'center',
        margin: [10, 5, 10, 5],
      });
    });

    body.push(firstRow);
    body.push(secondRow);
    body.push(thirdRow);

    return body;
  }

  buildTableBody(data: any, columns: any) {
    let body = [];
    body.push(columns);
    data.forEach(function (row: any) {
      let dataRow: any = [];
      columns.forEach(function (column: any) {
        dataRow.push(row[column].toString());
      });
      body.push(dataRow);
    });
    return body;
  }

  table(data: any, columns: any) {
    return {
      table: {
        headerRows: 1,
        body: this.buildTableBody(data, columns),
      },
    };
  }

  getHeaderImage() {
    return 'data:image/png;base64,';
  }

  getFooterImage() {
    return 'data:image/png;base64,';
  }
}
